import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module'; // Ensure this path is correct
import { AppComponent } from './app.component';
import { NavBarComponent } from './nav-bar/nav-bar.component'; // Ensure this path is correct
import { LoginComponent } from './login/login.component'; // Ensure this path is correct
import { ProductListComponent } from './main/product-list/product-list.component'; // Ensure this path is correct

@NgModule({
  declarations: [
    AppComponent,
    NavBarComponent,
    LoginComponent,
    ProductListComponent // Declare your components here
  ],
  imports: [
    BrowserModule,
    AppRoutingModule // Include the routing module here
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
